#include <iostream>
#include <vector>
#include <unordered_map>
using namespace  std;

class Solution {
public:
    int minDomionRotationsHelper(vector<int>& tops, vector<int>& bottoms, int value)
    {
       int atA = 0;
       int atB = 0;
       for(int i =0; i < tops.size(); i++)
       {
           if(tops[i]!= value && bottoms[i] != value)
               return -1;
           else if(tops[i] != value) //if it is not present here then we have to swap with bottom
           {
               atA++;
           }
           else if(bottoms[i]!=value) //if it not present here then we have to swap with tops
           {
               atB++;
           }
       }
       return min(atA,atB);
    }
    int minDominoRotations(vector<int>& tops, vector<int>& bottoms)
    {
        int minSwap = INT_MAX;
        for(int i = 1;i <=6 ;i++)
        {
            int swaps = minDomionRotationsHelper(tops,bottoms,i);
            if(swaps!= -1)
            {
                minSwap = min(swaps,minSwap);
            }
        }
        return minSwap == INT_MAX ? -1 : minSwap;
    }
};

